import React from 'react';
import ReactDOM from 'react-dom';
import "./index.css"
import Sdata from "./Sdata"
import Cards from "./Cards"


ReactDOM.render(
  <>
  <h1 className = 'heading'> Integrated-Home Unified Stability Test System </h1>

  {Sdata.map(function ncard(val){

        return(

          <Card

          sname={val.sname}
          imgsrc={val.imgsrc}
          title={val.title}
          links={val.links}
          />

  );
  })}

  </>

  ,document.getElementById('root')
);
